import React from 'react';
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'

function App() {
  let users =[
  {id:1, name: 'Josh' , email:'josh@gmail.com'},
  {id:2, name: 'John' , email:'john@gmail.com'},
  {id:3, name: 'Jot' , email:'jot@gmail.com'},
  {id:4, name: 'Jony' , email:'jony@gmail.com'},


  ]
  return (
    <div className="App">
    <h1>Recat Dynamic Routing</h1>
    {
      users.map((item)=>
      <div><Link to={"/users/"+item.id}><h3>{item.name}</h3></Link></div>
      )


    }


    </div>
  );
}

export default App;
